import React from 'react';
import { Link } from "react-router-dom";
import '../css/Navigation.css';

class Navigation extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      style: "link"
    }
    this.handleMouseLeavehandleMouseLeave = this.handleMouseLeavehandleMouseLeave.bind(this);
  }
  handleMouseLeavehandleMouseLeave(e) {
    var style = e.target.className 
    if(style === "link") e.target.className = "hover"
    if(style === "hover") e.target.className = "link"
  }
  handleMouseLeave(e) {
    var style = e.target.className 
    if(style === "link") e.target.className = "hover"
    if(style === "hover") e.target.className = "link"
  }
  render() {
    return (
      <div>
        <Link to={`/home`}>
          <button className="link" onMouseOver={this.handleMouseLeavehandleMouseLeave} onMouseLeave={this.handleMouseLeavehandleMouseLeave}>
            Home
          </button>
        </Link>
        <Link to={`/about`}>
          <button className="link" onMouseOver={this.handleMouseLeavehandleMouseLeave} onMouseLeave={this.handleMouseLeavehandleMouseLeave}>
            About
          </button>
        </Link>
        <Link to={`/portfolio`}>
          <button className="link" onMouseOver={this.handleMouseLeavehandleMouseLeave} onMouseLeave={this.handleMouseLeavehandleMouseLeave}>
            Portfolio
          </button>
        </Link>
        <Link to={`/resume`}>
          <button className="link" onMouseOver={this.handleMouseLeavehandleMouseLeave} onMouseLeave={this.handleMouseLeavehandleMouseLeave}>
            Resume
          </button>
        </Link>
        <Link to={`/contact`}>
          <button className="link" onMouseOver={this.handleMouseLeavehandleMouseLeave} onMouseLeave={this.handleMouseLeavehandleMouseLeave}>
            Contact
          </button>
        </Link>
      </div>
  )
} 
}

export default Navigation;
